import React from "react";
import ReactDOM from "react-dom";
import Card from "./App";
import Array from "./Array";
function ncard(val){
    console.log(val)
    return (<Card
      img={val.img}
      title={val.title}
      span={val.span}
      ankar={val.ankar}
    />)
}

ReactDOM.render(
  <>
    {Array.map(ncard)}
  </>,
  document.getElementById("root")
);
